export const siteData = {
  "title": "Ben's Notes",
  "description": "前端大龙凤",
  "base": "/benNotes/",
  "pages": [
    {
      "key": "v-73aabce12c071",
      "path": "/",
      "title": "Home",
      "frontmatter": {
        "home": true,
        "heroImage": "/img/heroImage.jpg",
        "actionText": "Go Get'em",
        "actionLink": "/intro/fe-knowledge.md",
        "features": [
          {
            "title": "Simplicity First",
            "details": "Minimal setup with markdown-centered project structure helps you focus on writing."
          },
          {
            "title": "Vue-Powered",
            "details": "Enjoy the dev experience of Vue + webpack, use Vue components in markdown, and develop custom themes with Vue."
          },
          {
            "title": "Performant",
            "details": "VuePress generates pre-rendered static HTML for each page, and runs as an SPA once a page is loaded."
          }
        ],
        "footer": "MIT Licensed | Copyright © 2019-present Ben"
      }
    },
    {
      "key": "v-5df8404ff1561",
      "path": "/intro/fe-knowledge.html",
      "title": "前端开发入行指南",
      "headers": [
        {
          "level": 2,
          "title": "前言",
          "slug": "前言"
        },
        {
          "level": 2,
          "title": "学习计划",
          "slug": "学习计划"
        },
        {
          "level": 3,
          "title": "路线图",
          "slug": "路线图"
        }
      ]
    },
    {
      "key": "v-eea867ffcf2f3",
      "path": "/react/react-knowledge.html",
      "title": "React",
      "headers": [
        {
          "level": 2,
          "title": "Hooks",
          "slug": "hooks"
        },
        {
          "level": 3,
          "title": "State hook",
          "slug": "state-hook"
        }
      ]
    }
  ],
  "themeConfig": {
    "nav": [
      {
        "text": "Home",
        "link": "/"
      },
      {
        "text": "profile",
        "link": "/profile/"
      },
      {
        "text": "GitHub",
        "link": "https://github.com/amusiq/benNotes"
      }
    ],
    "sidebarDepth": 3,
    "sidebar": {
      "/refs": false,
      "/": [
        {
          "title": "前端知识",
          "children": [
            "intro/fe-knowledge.md"
          ],
          "collapsable": true
        },
        {
          "title": "React",
          "children": [
            "react/react-knowledge.md"
          ],
          "collapsable": true
        }
      ]
